        }

        .ayimgui {
            position: fixed;
            width: 360px;

        }

        .onlyTitle {
            height: 21px !important;
        }

        .ayimgui .aytitle {
            padding: 0 5px;
            font-size: 16px;
            background-color: #76c0e0;
        }

        .ayimgui .aytitle .titleClose {
            position: absolute;
            top: 3px;
            right: 6px;
            color: #000;
        }

        .ayimgui .aytitle .titleClose:hover {
            color: #eb9797;
        }

        .ayimgui .aybody {
            padding: 15px;
            height: calc(100% - 21px - 15px - 15px);
            overflow: auto;
            font-size: 14px;
        }


        .aytext {
            width: 100%;
            margin-bottom: 10px;
            display: flex;
            flex-direction: column;
            justify-content: space-around;
            color: #000;
            text-align: center;
            background: linear-gradient(80deg, #ff0000, #ff4800, #eeff00, #1cff08, #01ffb3, #0051ff, #a200ff, #e100ff, #ff0080, #ff0055, #ff0022);
            background-size: 120%;
            -webkit-text-fill-color: transparent;
            -webkit-background-clip: text;
            animation: animate 2s linear infinite;
        }


        .el-radio {
            margin: 8px 0;
        }

        .el-radio__label {
            color: #000;
        }

        .el-radio__input.is-checked+.el-radio__label {
            color: #000000;
        }

        .el-radio__inner {
            background-color: rgb(254, 254, 254);
            border: none;
        }

        .el-radio__input.is-checked .el-radio__inner {
            background-color: rgb(254, 254, 254);
        }

        .el-radio__inner::after {
            width: 10px;
            height: 10px;
            background-color: rgb(0,0,0);
        }

        .onlySelect {
            background-color: rgb(254, 254, 254);
            border: none;
        }

        .onlySelect .el-select-dropdown__item {
            color: #000;

        }

        .onlySelect .el-select-dropdown__item.hover,
        .el-select-dropdown__item:hover:hover {
            background-color: transparent;
        }

        .onlySelect .popper__arrow {
            border-bottom-color: rgb(254, 254, 254) !important;
        }

        .onlySelect.el-popper[x-placement^=bottom] .popper__arrow::after {
            border-bottom-color: rgb(8254, 254, 254) !important;
        }

        .el-select {
            width: 100%;
        }

        .el-select .el-input {
            background-color: rgb(254, 254, 254);
        }

        .el-select .el-input__suffix {
            background-color: rgb(255,255,255);
            color: #000;
            right: 0;
        }

        .el-select .el-select__caret {
            color: #000;
        }

        .el-select .el-input__inner {
            background-color: transparent;
            border: none;
            color: #000;
        }

        .el-select .el-input .el-select__caret {
            color: #000;
        }

        /* Ëß£ÂÜ≥ios‰∏ãÊãâÈúÄË¶ÅÁÇπ‰∏§Ê¨° */
        .el-scrollbar .el-scrollbar__bar {
            opacity: 1 !important;
        }

        .el-button {
            font-size: 14px;
            padding: 5px 10px;
            line-height: 14px;
            color: #000;
            background-color: #FFFFFF;
        }

        .el-button:hover {
            opacity: .7;
            color: #000;
            background-color: #000000;
        }

        .el-button:focus,
        .el-button:hover {
            color: #000;
            background-color: #000000;
        }

        .aycollapse {
            width: 100%;
            font-size: 14px;
            background-color: rgb(217, 212, 212);
            color: #000;
        }

        .aytab {
            width: 100%;
            height: 20px;
            display: flex;
            border-bottom: 2px solid rgb(198, 191, 191);
        }

        .aytab span {
            padding: 0 5px;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            background-color: rgb(255,255,255);
            color: #000;
            font-size: 14px;
            font-weight: 500;
            margin-left: 10px;
            border-radius: 6px 6px 0 0;
            cursor: pointer;
        }


        .el-input input {
            background-color: rgb(232, 227, 227);
            border: none;
            border-radius: 0px;
        }
        button {
            width: 75%;
            height: 25px;
            text-size-adjust: 7px;
            background-color: #f6f8f5f1;
            display: inline-block;
            cursor: pointer;
            text-align: center;
            text-decoration: none;
            outline: none;
            border: 2px solid #b6ebb9;
            border-radius: 20px;
            padding: 0px 8px;
            margin: 3px 40px;
            font-size: 17px;
            background: linear-gradient(80deg, #ff0000, #ff4800, #eeff00, #ef69dd, #dfd439, #d7647b, #a200ff, #e100ff, #ff0080, #ff0055, #ff0022);
            -webkit-text-fill-color: transparent;
            -webkit-background-clip: text;
            animation: animate 2s linear infinite;
        }
        @keyframes animate {
            0% {
                background-position: 0% 50%;
            }
            50% {
                background-position: 100% 50%;
            }
            100% {
                background-position: 0% 50%;
            }
        }
        button:active {
            transform: translateY(3px);
        }

<script language="JavaScript">
    window.onload = function() {
        document.addEventListener("contextmenu", function(e) {
            e.preventDefault();
        }, false);
        document.addEventListener("keydown", function(e) {
            //document.onkeydown = function(e) {
            // "I" key
            if (e.ctrlKey && e.shiftKey && e.keyCode == 73) {
                disabledEvent(e);
            }
            // "J" key
            if (e.ctrlKey && e.shiftKey && e.keyCode == 74) {
                disabledEvent(e);
            }
            // "S" key + macOS
            if (e.keyCode == 83 && (navigator.platform.match("Mac") ? e.metaKey : e.ctrlKey)) {
                disabledEvent(e);
            }
            // "U" key
            if (e.ctrlKey && e.keyCode == 85) {
                disabledEvent(e);
            }
            // "F12" key
            if (event.keyCode == 123) {
                disabledEvent(e);
            }
        }, false);

        function disabledEvent(e) {
            if (e.stopPropagation) {
                e.stopPropagation();
            } else if (window.event) {
                window.event.cancelBubble = true;
            }
            e.preventDefault();
            return false;
        }
    };
